import React, { Component } from 'react';
import Header from './Header';
import "./../App.css";
import Footer from './Footer';
import Content from './Content';


class App extends Component {

  render() {
    return (
      <div className="container-fluid">
        <Header></Header>
        {/* <Content></Content> */}
        <div class="card" style={{ width: "350px", height: "150px" }}>
          <div className="row">
            <div className="col-5" ><img src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/12/User_icon_2.svg/220px-User_icon_2.svg.png" style={{ height:"140px", borderRadius:"50%", marginTop:"7px"}}/></div>
            <div className="col-7">
              <div class="list-group">
                <a href="#" class="list-group-item list-group-item-action active">Active item</a>
                <a href="#" class="list-group-item list-group-item-action">Item</a>
                <a href="#" class="list-group-item list-group-item-action disabled">Disabled item</a>
              </div>
            </div>

          </div>
        </div>
        <Footer></Footer>
      </div>
    )

  }
}

export default App;
